import AudiLogo from '../assets/audi-logo-png-732.png'

export default function dealerLogo() {
  return (

    <div className="logo-top">
<img className="logo-dealer" src={AudiLogo} height="30"/> 

<h3>Audi Fredericia</h3>

    </div>
  )
}
